import React, { Component } from 'react';
import {
    Grid
} from "@material-ui/core";

class Home extends Component {
    render() {
        return (
            <Grid container direction="column" justify="center" alignItems="center">
                <h1>Colin Perepelken</h1>
                <h2>Software Developer</h2>
            </Grid>
        );
    }
}

export default Home;
